path.style:
paint-order: fill;
stroke: rgb(178, 191, 195);
fill: rgba(255, 255, 255, 0);
stroke-width: 4px;
stroke-linecap: round;
stroke-linejoin: round;

polyline.style:
stroke: rgb(178, 191, 195);
fill: rgba(255, 255, 255, 0);
stroke-width: 4px;
stroke-linecap: square;
stroke-linejoin: bevel;

path.style:
fill: rgb(216, 216, 216);
stroke-linecap: round;
stroke-width: 3px;
stroke: rgb(178, 191, 195);
